import React from "react";
import Carousel from "react-bootstrap/Carousel";


const CarouselItemBrand = (props) => {
    return (
        <> 
        <Carousel.Item>
            <img
                className="d-block w-100"
                src={props.src}
                alt={props.title}
            />
        </Carousel.Item>
        </>
    );
};


export default CarouselItemBrand;
